like falling into a spinning abyss of numbers and symbols. Just thinking about it seemed like an abuse of my brain. However, my entire tuition was financed by an academic scholarship, so I had to maintain high marks in all of my classes, including Math.\r\n\r\nMy most abstruse class was Advanced Calculus Mathematics. It was taught in a large lecture hall which abutted the North access gate of the University. Unlike the many absentees in my class who often abstained from attending the boring lectures, I dared not absolve myself from this responsibility. Any degree of absenteeism would probably cause me to fail Math and to lose my scholarship. I was so afraid of failing that even pledged abstinence from my abundant supply of alcohol. It wasn&rsquo;t until the fourth week of Math class that I met the wonderful person who would accelerate my intereset and understanding of this absurd subject. She was a foreign exchange student from Beijing. She was also a brilliant mathematician. She would come to class everyday in a colorful silk scarf that accentuated her lovely smile.\r\n\r\nIt was so nice to meet someone from my home country. She inspired me to love Math. Althought we now live and teach in different countries, I still see her smiling face between every number I write!', 'http://pa5vtka0q.bkt.clouddn.com/teacher/image/2018/7/9/ae00792e2d8f4254aef0aa3ee7ee3acd.jpg', 'http://pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/7/9/6da0753b63bc4bf68eba4da2a5333657.mp3', 'absenteeism n.  absentee n.  absolve v. 1. 2.  absorb vt. 1.  2.  absorbing adj.  abstain v.  abstinence n.  abstract adj. 1.  2.  abstraction n. \r\n\r\nabstruse adj.  absurd adj.  abundant adj.  abuse n.  abut vi.  abyss n.  academic adj.  academician n.  accelerate v. 1. 2. &hellip;&hellip; accentuate v.  access n. 1. () 2. ', 'http://pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/7/9/4041c233f0244a349647e3fe9f7c945f.mp3', '0', 4, '0e25294ea04643a6b5eb3f41eb3b9a93', '1', '2018-07-09 21:55:34.030');

