INSERT INTO `lession_info` VALUES ('1a4bdd4dcf6d46c394842b3b376fbf52', 'You can call me AJ', 'You can call me A.J., which is an abbreviation of my full name, Alexander Justice. I like to abbreviate my name because it\'s easier for people to remember. I work for a museum that collects aboriginal artifacts.\r\n\r\nI would like to tell you why I have an abiding faith in the legal system. The story you\'re about to read has been abridged to reduce its length.\r\n\r\nI used to live in an area where criminals abounded and where the legal system seemed powerless. One day, my daughter was abducted. Although I abided by the kidnapper\'s monetary demands, they refused to release her. I had no choice but to put my faith in the legal authorities. The police responded immediately and searched the area. Despited their lack of success, they refused to abandon their search or to call an abort to their mission. They knew that any abortive action would surely result in my daughter\'s death.\r\n\r\nThe investigation eventually led the police to conduct an abrupt search at the home of a local official who was abashed when he learned of the search. My daughter was found in his basement. She had abrasions to her wrists where the abrasive rope had scraped her. The official was arrested along with his bodyguard who abetted him in the kidnapping.\r\n\r\nThe official was forced to abdicate his position and was sent to prision for life. The judge told him that he was lucky that captial punishment had been abolished and that it was only due to this abolition that he would not be executed. The swift apprehension and strict punishment of these criminals helped to abate my lack of faith in the legal system. These days, I truly believe in &quot;justice&quot;, and it\'s not because of my name!', 'http://pa5vtka0q.bkt.clouddn.com/teacher/image/2018/7/9/406613ea164a4be895dd3d7e9e8927c3.jpg', 'http://pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/7/9/2e09df232456474ab942b9788137b902.mp3', 'abandon vt.  n.\r\n\r\nINSERT INTO `lession_info` VALUES ('1e84407252e44c4386e11af41e0b3197', 'tetextex', 'ddddddddddddddddddddddddd', 'http://pa5vtka0q.bkt.clouddn.com/teacher/image/2018/6/11/1e84407252e44c4386e11af41e0b3197', 'pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/6/11/1e84407252e44c4386e11af41e0b3197', '11dsadadsadasdsadsaaaaaaaaaaaaaaaa', 'pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/6/11/1e84407252e44c4386e11af41e0b3197', '1', 1, '0bb70374652f493bbd849d9b326a77f9', '1', '2018-06-11 22:12:55.373');
INSERT INTO `lession_info` VALUES ('24240f6271cd405ca1b0c176c7c185eb', 'Love of Numbers', 'As an academician, I think Mathematics is an intriguing and absorbing science. However, many of my students consider it an abstract science and they hate it because the equations are too difficult to absorb and to remember. I think my students would laugh if they know how I became so interested in Math. When I was a freshman in college, I also believed Math was a mere abstraction. Studying it was\r\n\r\nINSERT INTO `lession_info` VALUES ('3097c5478fd24e3ebe863bd2ca2f0455', '', '', 'http://pa5vtka0q.bkt.clouddn.com/teacher/image/2018/6/12/3097c5478fd24e3ebe863bd2ca2f0455', 'http://pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/6/12/3097c5478fd24e3ebe863bd2ca2f0455', '', 'http://pa5vtka0q.bkt.clouddn.com/teacher/studio/2018/6/12/3097c5478fd24e3ebe863bd2ca2f0455', '1', 3, '213083ee0c1c43d594705a4f708a4e20', '1', '2018-06-12 15:44:06.060');
